import React, { useState, useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";
import HideAppBar from "./components/AppBar";
import RecipeReviewCard from "./components/CityCard";
import { getWeather } from "./Actions";

function App() {
  const [data, setData] = useState({
    weather: [],
  });
  const { weather } = data;

  useEffect(() => {
    loadWeather();
  }, []);

  const loadWeather = () => {
    getWeather().then((data) => {
      setData({ ...data, weather: data });
    });
  };

  return (
    <div className="App">
      <header className="App-header">
        <HideAppBar />
        <a>fad</a>
        {weather}
      </header>
    </div>
  );
}

export default App;
